            {props.productsList.map((item, index) => {
                return (<div>
                    <h2>{item.prodDescription}</h2>
                    {/* <input key={index} className="tiny ui button" type="button" value="Delete" onClick={() => { props.deleteGroup(item) }} /> */}
                </div>
                )
            })}
        </div></>);

}

const myMapStateToProps = (state) => {
    return {
        productsList: state.auction.productsList
    }
}
export default connect(myMapStateToProps)(ProductsList);
